import os
import re
import subprocess

FILENAME_REGEX = re.compile(r"(\d{9})_(\d{9})_assignment1.zip")
TIMEOUT = 5


def is_valid_filename(filename: str):
    """Checks that filename is of the sort id1_id2_bc.c"""
    return FILENAME_REGEX.match(filename)


def is_valid_id(id: str):
    """See https://he.wikipedia.org/wiki/%D7%A1%D7%A4%D7%A8%D7%AA_%D7%91%D7%99%D7%A7%D7%95%D7%A8%D7%AA"""

    if id == "111111111":
        """If you do the assignment on your own"""
        return True

    def twice(x: int):
        result = 2 * x
        if result >= 10:
            return result % 10 + result // 10
        return result

    checksum = (
        int(id[0])
        + twice(int(id[1]))
        + int(id[2])
        + twice(int(id[3]))
        + int(id[4])
        + twice(int(id[5]))
        + int(id[6])
        + twice(int(id[7]))
    ) % 10

    checksum = 10 - checksum if checksum != 0 else 0

    return int(id[8]) == checksum


def find_hw_files():
    return [f for f in os.listdir(".") if is_valid_filename(f)]


def get_hw_file():
    files = find_hw_files()
    assert (
        len(files) != 0
    ), "There no valid homeworks (id1_id2_assignment1.zip) in this folder!"
    assert len(files) == 1, "There are too many homeworks in this folder!"

    return files[0]


def test_filename():
    """Makes sure that the filename is of the sort id1_id2_assignment1.zip"""

    m = FILENAME_REGEX.match(get_hw_file())
    assert is_valid_id(m.group(1)), f"Invalid ID {m.group(1)}"
    assert is_valid_id(m.group(2)), f"Invalid ID {m.group(2)}"


def test_extracts():
    """Makes sure that the project extracts successfully"""

    f = get_hw_file()
    os.system("rm -rf hw1")
    assert os.system(f'unzip "{f}" -d hw1 >/dev/null') == 0

    os.chdir("hw1")
    files = os.listdir(".")
    assert (
        len(files) == 1
    ), "Invalid zip, use the exact command specified in the instructions!"

    folder = files[0]
    assert os.path.isdir(
        folder
    ), "Invalid zip, use the exact command specified in the instructions!"

    os.chdir(folder)
    assert sorted(os.listdir(".")) == [
        "kmeans.c",
        "kmeans.py",
    ], "Invalid zip, make sure the files are named 'kmeans.c' and 'kmeans.py' exactly!"


def test_compiles():
    assert (
        os.system("gcc -ansi -Wall -Wextra -Werror -pedantic-errors kmeans.c -lm -o kmeans")
        == 0
    )


