def test_inputs(test):
    k, n, d, input_data, output_data, *other = test
    iter_arg = [str(other[0])] if len(other) == 1 else []

    p = subprocess.Popen(
        ["./kmeans", str(k), str(n), str(d)] + iter_arg,
        stdin=subprocess.PIPE,
        stdout=subprocess.PIPE,
        stderr=subprocess.PIPE,
    )
    p.stdin.write(input_data.encode())
    p.stdin.flush()

    assert (
        p.wait(TIMEOUT) is not None
    ), "Program should exit after getting valid test data!"
    assert p.stdout.read() == output_data.encode()

    with open("input_data.txt", "w") as f:
        f.write(input_data)

    p = subprocess.Popen(
        ["python3", "kmeans.py", str(k), str(n), str(d)]
        + iter_arg
        + ["input_data.txt"],
        stdin=subprocess.PIPE,
        stdout=subprocess.PIPE,
        stderr=subprocess.PIPE,
    )

    assert p.wait(TIMEOUT) is not None, "Program should exit after getting valid test data!"
    assert p.stdout.read() == output_data.encode()

